import React from 'react'
import data from './data.json'


const Landing = () => {
    return (
        <div className='bg-black text-white p-10 text-center'>
            <div className='flex flex-col'>
                <div className='flex flex-col'>
                    <div className='text-4xl font-bold mt-5'>{data.heading}</div>
                    <div className='text-lg font-medium mt-5'>{data.content}</div>
                </div>
                <div className='flex justify-center mt-16'>
                    <a className='bg-white text-black text-lg rounded-full p-2 px-6 font-semibold' href={"https://pancakeswap.finance"} target="_blank" rel="nofollow noopener noreferrer">Buy Now</a>
                </div>
            </div>
        </div>
    )
}

const Section1 = () => {
    return (
        <div className='bg-black text-white p-10 text-center'>
            <div className='flex flex-col'>
                <div className='text-base font-bold opacity-50'>OUR PURPOSE</div>
                <div className='flex flex-col mt10'>
                    <div className='text-4xl font-bold mt-5'>{data.Section1.heading}</div>
                    <div className='text-lg font-normal mt-5'>{data.Section1.content}</div>
                </div>
            </div>
        </div>
    )
}

const Section2 = () => {
    return (
        <div>
            <div></div>
            <div></div>
        </div>
    )
}

const Main = () => {
    return (
        <div className='container mx-auto'>
            <Landing />
            <Section1 />
        </div>
    )
}

export default Main
